import { combineReducers } from "redux";
import productReducer from "./container/Home/reduce";
import productFootWearReducer from "./container/Footwear/reducer";
import productClothesReducer from "./container/Clothes/reducer";
import productAccessoryReducer from "./container/Accessory/reducer";
const rootReducer = combineReducers({
    products: productReducer,
    productFootWaer: productFootWearReducer,
    productClothes: productClothesReducer,
    productAccessory: productAccessoryReducer
})
export default rootReducer;
